def minCost(nums):
    total_cost = 0

    while nums:
        nums.sort()
        if len(nums) >= 2:
            cost = max(nums[0], nums[1])
            total_cost += cost
            nums = nums[2:]
        else:
            cost = max(nums)
            total_cost += cost
            nums = []

    return total_cost

