def calculate_kaduku(elements):
    return max(elements) - min(elements)

def remove_redundant_elements(elements):
    return list(set(elements))

def main():
    elements = [int(x) for x in input("Enter numbers separated by space: ").split()]

    if len(elements) < 2:
        print("Need at least two elements to calculate Kaduku.")
        return

    kaduku = calculate_kaduku(elements)
    print("Kaduku:", kaduku)

    unique_elements = remove_redundant_elements(elements)
    print("Unique elements:", unique_elements)

if __name__ == "__main__":
    main()
